import "./navbar.css";

const Navbar = () => {

    return (
        <div className="navbar"> 
            <h1>Menu will be here!</h1>
        </div>
    );
}

const Footer = () => {

    return (
        <div className="footer"> 
            <footer>Created by Felix Almonte</footer>
        </div>
    );
}




export default Navbar;
